    return (
        <div>
        <h2>Phonebook</h2>
        <form>
            <Field
                label={ 'Foo' }
                value={ input }
            />
            <Submit label={ 'Add' } />
        </form>
        <h2>Numbers</h2>
        ...
        </div>
    )
}

const Field = ({ label, value, func }) => { return (
    <div>
        <input
            placeholder={ label }
            value={ value }
        />
    </div>
)}

const Submit = ({ label }) => { return (
    <div>
        <button>{ label }</button>
    </div>
)}

export default App
